import itemCosmonautSpacesuit from "../assets/itemCosmonautSpacesuit.png";
import itemRubberChicken from "../assets/itemRubberChicken.jpg";
import itemUTLibrem5 from "../assets/itemUTLibrem5.png";
import itemWatchBinary from "../assets/itemWatchBinary.png";

// created individual menu items w/ data
export const MenuList = [
    {
        name: "Aliens",
        image: itemAlienAssistant,
        price: '125,000.00',
    },
    {
        name: "Cosmonaut Spacesuit",
        image: itemCosmonautSpacesuit,
        price: '82,000.00',
    },
    {
        name: "Rubber Chicken",
        image: itemRubberChicken,
        price: 12.99,
    },
    {
        name: "Librem 5 UT Edition",
        image: itemUTLibrem5,
        price: 750.00,
    },
    {
        name: "Binary Watch",
        image: itemWatchBinary,
        price: 28.00,
    },  
];
